import React, { Component, Fragment } from 'react'
import { push } from 'connected-react-router'
import { bindActionCreators } from 'redux'
import { connect } from 'react-redux'
import { loadOpenApis } from '../../actions/apiActions'

class Home extends Component {

  componentDidMount() {
    this.props.loadOpenApis(0); 
  }

  renderHero() {
    return (
      <div className="position-relative overflow-hidden p-3 p-md-5 m-md-3 text-center bg-light">
        <div className="col-md-5 p-lg-5 mx-auto my-5">
          <h1 className="display-4 font-weight-normal">OpenAPI Portal</h1>
          <p className="lead font-weight-normal">
            The best ever portal
      </p>
          <a className="btn btn-outline-secondary" href="#">Coming soon</a>
        </div>
        <div className="product-device shadow-sm d-none d-md-block"></div>
        <div className="product-device product-device-2 shadow-sm d-none d-md-block"></div>
      </div>
    );
  }

  renderOpenAPI() {
    return (

      <div className="d-md-flex flex-md-equal w-100 my-md-3 pl-md-3">
        <div className="bg-light mr-md-3 pt-3 px-3 pt-md-5 px-md-5 text-center overflow-hidden">
          <div className="my-3 p-3">
            <h2 className="display-5">{}</h2>
            <p className="lead">Published by ABC Company.</p>
          </div>
          <div className="bg-dark shadow-sm mx-auto api-desc">
            <div className="pt-5">
            Stock and Forex Data and Realtime Quotes
            </div>

          </div>
        </div>

        <div className="bg-light mr-md-3 pt-3 px-3 pt-md-5 px-md-5 text-center overflow-hidden">
          <div className="my-3 p-3">
            <h2 className="display-5">Starbuck API Title</h2>
            <p className="lead">Published by Starbuck Company.</p>
          </div>
          <div className="bg-dark shadow-sm mx-auto api-desc">
            <div className="pt-5">
              Stock and Forex Data and Realtime Quotes
            </div>
          </div>
        </div>


      </div>
    )
  }

  render() {
    return (
      <Fragment>
        {this.renderHero()}
        {this.renderOpenAPI()}
        {this.renderOpenAPI()}
        total; [this.props.total]
      </Fragment>

    );
  }
}


const mapStateToProps = ({ openapis }) => ({
  count: openapis.total,
  apis: openapis.apis,

})

const mapDispatchToProps = dispatch =>
  bindActionCreators(
    {
      loadOpenApis: (page) => loadOpenApis(page),
      changePage: () => push('/about-us')
    },
    dispatch
  )

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Home)
